import React, { Component } from 'react'
import Empolyees from './Empolyees'


class App extends Component{

  render(){

    let matrix = [
      {id: 1,     img:'https://picsum.photos/250',    name:'Leo',     job : 'Actor',        phone : '+964782232112',     email : 'asd@leonardo.com',     website : 'www.leo.com',},
      {id: 2,     img:'https://picsum.photos/250',    name:'Mac',     job : 'Actor',        phone : '+964782232112',     email : 'asd@leonardo.com',     website : 'www.leo.com',},
      {id: 3,     img:'https://picsum.photos/250',    name:'John',     job : 'Actor',        phone : '+964782232112',     email : 'asd@leonardo.com',     website : 'www.leo.com',},
      {id: 4,     img:'https://picsum.photos/250',    name:'Mike',     job : 'Actor',        phone : '+964782232112',     email : 'asd@leonardo.com',     website : 'www.leo.com',},
    ]

    const mem = matrix.map((employee) => {
      return(
            <Empolyees
            key = {employee.id}
            img = {employee.img}
            name = {employee.name}
            job = {employee.job}
            phone = {employee.phone}
            email = {employee.email}
            website = {employee.website}
            />
      )
    })
    return(
      <div>
        {mem}

      </div>
    )
  }
}


export default App
